import "./styles.css";
import logoSrc from './assets/logo.svg';


export function Logo({ className }) {
  return (
    <a href="/" className={`${className} logo`}>
      <img src={logoSrc} alt="Логотип компании" className="logo__pic" />
    </a>
  );
}
